NEW AND UNUSED!!!

Radical Firearms 16" M4 Carbine Complete Upper -
- 12" quad rail;
- flat top, law-enforcement grade, drop in receiver, ready to be mounted to any Mil-Spec AR-15 lower receiver;
- fully mil-spec compliant receiver; comes complete and assembled with Upper Receiver, Forward Assist, Ejection Port Door, free float handguard;
- 16" M4 Profile Barrel, A2 Flash Hider, and Melonite coated Bolt Carrier Group (the BCG was a $94 upgrade);
- Forged Mil-Spec M4; M4 Feed Ramps; Forward Assist & Port Cover; T-Marks Barrel Characteristics;
- 1:7 twist rate barrel for higher grain bullet capability;
- barrel is NOT cheaper chrome moly, melonite barrel

SKU#: RFUPPERBF

Lionheart Industries LH9C Novak Edition is a semiauto pistol built on a forged 7075-T6 aluminum frame with a forged 4140 steel slide and forged 4150 steel barrel. It’s chambered in 9mm. It’s reportedly based on the Daewoo K5 pistol.
Other features include:
The LH9C Novak Edition
* Angled slide serrations;
* a rounded hammer;
* an ambidextrous manual safety;
* a passive firing pin block;
* Novak Lo-Mount 380 sights
* one-piece, black, diamond-checkered polymer grips;
* Custom coyote tan and black cerakote finish on the frame and magazines
* a full-length steel guide rod;
* a DA/SA/DA+ trigger system;* and
* a soft case with cleaning equipment and a trigger lock.
* Black G-code Incog kydex conceal holster 
* Tan custom kydex belt holster.
* Barely used, only approx 250 rds through weapon.
* All manufacturers manuals

To my regret, financial pressure requires me to part with my beloved Olympic Arms K3B-M4-A3-TC. Originally purchased in 2008, in good condition (minor external dings and abrasions, cosmetic only). Comes with original OlyArms hard carrying case and 30-round magazine, and various accessories accumulated over the years, namely:
- Wilson Combat single-stage Tactical Trigger Unit;
- EoTech 516 sight, with (old model) 3x magnifier on a flip-to-side mount, and OlyArms flip-up back-up rear sight;
- Crimson Trace MVF-515 light/red laser foregrip;
- MagPul MOE stock, trigger guard, and rail covers, all in olive drab;
- Hogue grip (OD) with Samson "Field Survivor" tool housed within;
- Wilderness Giles sling (OD);
- six (6) MagPul Gen 1 PMAG Window 30-round magazines (OD);
- US Peacekeeper PDW carrying case (soft, black);
- OlyArms .22LR adaptor bolt (sorry, no magazines);
- spare bolt, gas rings, and assorted small parts in handy case

Will also be delivered with several hundred rounds of assorted .223/5.56mm ammunition. Greatly prefer to sell as a package. Happy to meet at any FFL around the northern half of I-405, Everett to Bellevue.
